import React from "react";

function Footer() {
  return (
    <div className="footer">
      <footer>
        <div class="container">
          <p class="m-0 text-center text-white">
            Kreana 2021
          </p>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
